import useStyles from './useStyles';
import { Card, CardMedia, CardContent, Typography, CardActions, Button } from '@material-ui/core';

const Home = (): JSX.Element => {
    const { root } = useStyles();
    return (
    <>
        <Card className={root}>
            <CardMedia
                component="img"
                height="140"
                image="https://airportshuttle0.s3.amazonaws.com/money.jpeg"
                alt="Debt"
            />
            <CardContent style={{ backgroundColor:'#00FFFF' }}>
                <Typography gutterBottom variant="h5" component="div">
                    Debt
                </Typography>
                <Typography variant="body2">
                    50 clients owe you moeny!
                </Typography>
            </CardContent>
            <CardActions>
                <Button size="small">Show</Button>
            </CardActions>
        </Card>
    </>
    );
};

export default Home;
